import (
	context "context"
	fernclient "github.com/chat/fern/client"
	option "github.com/chat/fern/option"
	v1 "github.com/chat/fern/v1"
)

client := fernclient.NewClient(
	option.WithToken(
		"<YOUR_AUTH_TOKEN>",
	),
)
response, err := client.V1.Chat(
	context.TODO(),
	&v1.ChatRequest{
		Message: "message",
	},
)

import (
	context "context"
	fernclient "github.com/chat/fern/client"
	option "github.com/chat/fern/option"
	v2 "github.com/chat/fern/v2"
)

client := fernclient.NewClient(
	option.WithToken(
		"<YOUR_AUTH_TOKEN>",
	),
)
response, err := client.V2.V2.Chat(
	context.TODO(),
	&v2.V2ChatRequest{
		Model: "model",
	},
)
